●カーメイトのソーラー電源付きの灰皿 DZ357<br>●夜間に便利なホワイトLED付きで、ソーラー電源で電池交換は不要<br>●開口部が斜めになっていて火消穴が見やすく、もみ消し面も大きくて使いやすい灰皿<br>●灰皿を注視する時間が短く済むため運転に集中できます<br><br>☆ラインアップ<br>ソーラーアッシュトレイ セレクト ブラック/ゴールド → DZ356<br>ソーラーアッシュトレイ セレクト アイボリー/ゴールド → DZ357<br>ソーラーアッシュトレイ セレクト クローム → DZ274<br>ソーラーアッシュトレイ セレクト ブルー → DZ275<br>ソーラーアッシュトレイ セレクト レッド → DZ276<br><br>【仕様】<br>■品名：ASHTRAY<br>■カラー：アイボリー/ゴールド(IVORY/GOLD)<br>■製品重量：270g<br>■製品サイズ：H135×W89×D83(mm)<br>■パッケージ重量：350g<br>■パッケージサイズ：H180×W130×D90(mm)<style type="text/css">
