【商品特徴】<br>缶ジュース型のかわいい灰皿です。缶ジュースモチーフで、ドリンクホルダーに入れても違和感がありません。<br><br>夜間や暗い場所でのご使用に便利な電池で光るブルーLED照明付き。（LEDの点灯消灯はフタの開閉に伴って作動します。）<br><br>穴に入れるだけで消火してくれる自然消火タイプです。<br><br>インナーボトルが外せて簡単に灰が捨てられます。<br><br>フタが付いているので、タバコの匂いが漏れません。<style type="text/css">
