【特長】<br>ドリンクホルダーに収まる太缶サイズの大容量灰皿。<br>タバコ置きに差し込むだけで消化できる1アクション火消口付き。（スーパースリムタバコ対応）<br>夜間の喫煙に便利な高輝度ブルーLED照明付き。<br>LED照明は蓋の開閉によるスイッチなので、ON/OFFが簡単。<br>蓋を閉じると火消しツマリ防止棒が火消し口に入り灰のツマリを防止。<br>コイン電池式。（リチュウムコイン電池CR1616使用）<br><br>【メーカー】<br>ヤック<br><br>【品番】<br>PZ-761<style type="text/css">
