【肌研(ハダラボ) 極潤 パーフェクトゲルの詳細】<br>
●うるおいにこだわる肌ラボシリーズのオールインワンゲル。<br>
●これひとつで化粧水＋乳液＋美容液＋クリーム＋パックの5役が完了します。これひとつでパックしたようにうるおい、吸いつくようなもちもち肌に！<br>
●スーパーヒアルロン酸（うるおい成分）を配合。濃い使い心地で角質層深くまでうるおいを届け、閉じ込めます。<br>
●無香料・無着色・鉱物油フリー・アルコール（エタノール）フリー。<br>
●健康な素肌と同じ弱酸性です。<br><br>

【使用方法】<br>
●朝晩の洗顔後、適量をとり、お肌にやさしくのばしてください。<br>
●洗い流す必要はありません。<br>
●製剤が濃厚なため、メイクをする際は、ティッシュで押さえる、又は時間をおいてからメイクするのをおすすめします。<br>
●他のスキンケアアイテムとの併用もできます。<br><br>

【ご注意】<br>
○肌に異常が生じていないかよく注意して使用すること<br>
○使用中、又は使用後日光にあたって、赤み、はれ、かゆみ、刺激、色抜け(白斑等)や黒ずみ等の異常が現れた時は、使用を中止し、皮フ科専門医等へ相談すること。そのまま使用を続けると症状が悪化することがある<br>
○傷、はれもの、湿疹、かぶれ等、異常のある部位には使用しないこと<br>
○目に入らないように注意し、入った時はすぐに水又はぬるま湯で洗い流すこと。なお、異常が残る場合は、眼科医に相談すること<br>
○高温又は低温の場所、直射日光を避け保管すること<br>
○乳幼児の手の届かないところに保管すること<br>
○衣服等につかないよう注意すること。(材質によっては落ちにくいことがある)<br><br>
【成分】<br>
水、BG、ヒドロキシエチルウレア、グリセリン、ペンチレングリコール、スクワラン、トリエチルヘキサノイン、(アクリロイルジメチルタウリンアンモニウム／VP)コポリマー、ジメチコン、アセチルヒアルロン酸Na(スーパーヒアルロン酸)、ヒアルロン酸Na、加水分解ヒアルロン酸(ナノ化ヒアルロン酸)、ヒアルロン酸ヒドロキシプロピルトリモニウム(肌吸着型ヒアルロン酸)、加水分解コラーゲン、グルコシルセラミド、スイゼンジノリ多糖体(サクラン)、アルギニン、デキストリン、カンテン、アクリレーツコポリマーアンモニウム、コハク酸、コハク酸2Na、フェノキシエタノール、PPG-17ブテス-17、クエン酸トリエチル、メチルパラベン、EDTA-2Na<br><br>

【内容量】<br>
100g<br><br>

【販売元】<br>
ロート製薬<br>
大阪市生野区巽西1-8-1<br>
