●たった１つでお手入れ完了のオールインワンジェル：美白＋化粧水＋乳液＋美容液＋クリーム＋パック＋潤い下地の７つの機能を１つに凝縮<br>
●3段階の保湿力<br>
即感性保湿：水分を吸収しにくくなったお肌に即感性のある潤い効果<br>
持続性保湿：潤いを保てなくなり、乾燥しやすいお肌に、長く続く潤い効果<br>
密閉性保湿：守る力が低下したお肌に被膜性のある成分で乾燥を防ぐ潤い効果<br>
●2種の有効成分：グリチルリチン酸ジカリウム、トラネキサム酸<br>
●12種の美容成分：コラーゲン・セラミド（N-ステアロイルフィトスフィンゴシン）・ヒアルロン酸・トレハロース・キシリトール・セイヨウナシ果汁発酵液・サクラ葉抽出液・アーティチョークエキス・オウゴンエキス・オウバクエキス・ユキノシタエキス・プルーン酵素分解物<br><br>

【使用方法】<br>
●洗顔後、適量を手にとり顔全体になじませてください。<br>
●下地としてお使いいただく場合、よくなじませてからファンデーションをご使用ください。<br>
●他のスキンケアと合わせてもお使いいただけます。<br><br>

【成分】<br>
有効成分：グリチルリチン酸ジカリウム、トラネキサム酸<br>
その他の成分：ヒアルロン酸ナトリウム(2)、コラーゲン・トリペプチド F、トレハロース、セイヨウナシ果汁発酵液、サクラ葉抽出液、アーティチョークエキス、オウゴンエキス、オウバクエキス、ユキノシタエキス、プルーン酵素分解物、精製水、キシリトール、1.3-ブチレングリコール、濃グリセリン、1.2-ペンタンジオール、ジグリセリン、パラオキシ安息香酸メチル、カルボキシビニルポリマー、水酸化カリウム、エデト酸二ナトリウム、メタリン酸ナトリウム、ポリオキシブチレンポリオキシエチレンポリオキシプロピレングリセリルエーテル(3B.O.)(8E.O.)(5P.O.)、トリ(カプリル・カプリン酸)グリセリル、トリ2-エチルヘキサン酸グリセリル、イソステアリン酸ポリオキシエチレングリセリル、ジイソステアリン酸ポリグリセリル、ポリオキシエチレン・メチルポリシロキサン共重合体、メチルポリシロキサン、塩化カリウム、フェノキシエタノール、水素添加大豆リン脂質、フィトステロール、N-ステアロイルフィトスフィンゴシン、d-σ-トコフェロール、天然ビタミンE<br><br>

